import React from "react";
import useApi from "./ContextApi";
import './whatchlist.css'
function Whachlist() {
  const apiFromContext = useApi();
  const arr = apiFromContext.props.value.whatchlist;
  const movies = Array.from([...arr]);
  return (
    <div className="container">
      {movies.length > 0 ? (
        <div className="container">
          movies.map((e) => <div>{e}</div>)
        </div>
      ) : (
        <div className="notfound">there is no films to show in whatvh list</div>
      )}
    </div>
  );
}

export default Whachlist;
